# pylint: disable=import-error, missing-module-docstring, missing-function-docstring, line-too-long
from fastapi.testclient import TestClient
from authentication.users import get_current_user
from data.models.users import User

from app.main import app


def test_post_classify(mocker):
    scores = [
        "n01440764 (score = 0.961476)",
        "n01443537 (score = 0.960827)",
        "n01484850 (score = 0.960790)",
        "n01494475 (score = 0.960720)",
        "n01498041 (score = 0.960680)",
    ]

    mocker.patch(
        "app.routers.classification.run_inference_on_image", return_value=scores)

    client = TestClient(app)

    async def override_dependency():
        return User()

    app.dependency_overrides[get_current_user] = override_dependency
    response = client.post(
        "/classify",
        json={
            "image": "" +
            "" +
            "" +
            "",
            "num_top_predictions": 1,
        },
        headers={"Authorization": "Bearer sadfsd"})

    assert response.status_code == 200
    assert response.json() == {"scores": scores}
